(function initButtonToTop() {
        $(window).scroll(function () {
            if ($(this).scrollTop() >= 500) {

                $('#button-to-top').fadeIn();

            } else {
                $('#button-to-top').fadeOut();
            }
        });

        $('#button-to-top').click(function () {

            $('body,html').animate({
                scrollTop: 0
            }, 800);

        });

    })(jQuery);


